import React from 'react'
import styled from 'styled-components/native';
import { TouchableOpacity } from 'react-native'


const Explore = () => {

    return (
        <>
            <Main>
                <Text>Explore</Text>

            </Main>
            <Footer />
        </>
    )
}

const Main = styled.View`
flex: 1;
background-color:#5A673E;
`
const Footer = styled.View``


export default Explore
